import React from 'react'
import PropTypes from "prop-types"
import { Input, InputNumber, Button } from 'antd'
import './Home.css'

export default class Home extends React.Component {
    static propTypes = {
        getUser: PropTypes.func,
        getUserInput: PropTypes.func,
        addUser: PropTypes.func,
    }

    constructor() {
        super()
        this.state = {
            currentValue: '',
        }
    }
    checkUser = (val) => {
        console.log('e target val: ', val.target.value)
        console.log('state currentValue: ', this.state.currentValue)
    }
     render() {
        const { getUser, getUserInput, addUser } = this.props
        return (
            <React.Fragment>
                <Input 
                    // onKeyPress={(event) => event.key !== 'Enter' ? this.setState({currentValue: event.target.value}) : (this.setState({currentValue: event.target.value}) && addUser(this.state.currentValue))}
                    onKeyPress={(e) => this.setState({currentValue: e.target.vaue}) && this.checkUser(e)}
                    className='search-box'
                />
            </React.Fragment>
        )
    }
}
